import React, { useState, useEffect, useContext } from 'react'
import { AppContext } from '../pages/Booking';

const ScheduleBooking = () => {
    const handleButtonClick = useContext(AppContext)
    const [next,setnext]=useState(true)
    const [monthData, setMonthData] = useState([]);
    const [displayedData, setDisplayedData] = useState([]);
    const [startIndex, setStartIndex] = useState(0);
    const button = [
        '10:00 AM',
        '10:30 AM',
        '11:00 AM',
        '11:30 AM',
        '12:00 PM',
        '12:30 PM',
        '01:00 PM',
        '01:30 PM',
        '02:00 PM',
        '02:30 PM',
        '03:00 PM',
        '03:30 PM',
        '04:00 PM',

    ]

    useEffect(() => {
        // Get the current date
        const currentDate = new Date();

        // Calculate the date of 1 month later
        const oneMonthLaterDate = new Date(currentDate);

        oneMonthLaterDate.setMonth(oneMonthLaterDate.getMonth() + 1);

        const data = [];
        let currentDateIterator = new Date(currentDate);

        while (currentDateIterator <= oneMonthLaterDate) {
            data.push({
                date: new Date(currentDateIterator),
            });
            currentDateIterator.setDate(currentDateIterator.getDate() + 1);
        }
        setMonthData(data);
        setDisplayedData(data.slice(startIndex, startIndex + 3));
    }, [startIndex]);


    const handleNextClick = () => {
        if (startIndex + 3 < monthData.length) {
            setStartIndex(startIndex + 3);


        }
    };
    const handlePreviewClick = () => {
        if (startIndex - 3 >= 0) {
            setStartIndex(startIndex - 3);
        }
    };
    const [selectedDate, setSelectedDate] = useState(null);
    const [selectedTime, setSelectedTIme] = useState(null);
    const [TimeButtonClicked, setTimeButtonClicked] = useState(null);
    const [DateButtonClicked, setDateButtonClicked] = useState(null);



    const handleDateClick = (item, index) => {
        setDateButtonClicked((prevIndex) => (prevIndex === index ? null : index));
        setSelectedDate(item.data)
        console.log(selectedDate);
        console.log(DateButtonClicked);

    };
    const handleTimeClick = (button, index) => {
        setTimeButtonClicked((prevIndex) => (prevIndex === index ? null : index));
        setSelectedTIme(button)
        console.log(TimeButtonClicked);
        console.log(selectedTime);
    };


    return (
        <>
            <div className='card  mx-auto mt-5' style={{ width: "80vw", height: '80vh' }}>
                <div className='d-flex justify-content-center flex-column  mt-5 m-3'>
                    <div className='d-flex mx-auto '>
                        <h1>Appointment Booking</h1>
                    </div>
                    <div className='d-flex border mx-auto border-secondary m-2 justify-content-between p-2 align-items-center gap-2  rounded' style={{ width: '70vw' }}>
                        <form>
                            {next ? <div>
                                <input type='date' />
                                <fieldset id='time'>
                                    <input type='radio' name='time' id='time1' className='btn-check' />
                                    <label for='time1' className='btn btn-outline-success'>10:00 AM</label>
                                    <input type='radio' name='time' id='time2' className='btn-check' />
                                    <label for='time2' className='btn btn-outline-success'>10:00 AM</label>
                                    <input type='radio' name='time' id='time3' className='btn-check' />
                                    <label for='time3' className='btn btn-outline-success'>10:00 AM</label>
                                    <input type='radio' name='time' id='time4' className='btn-check' />
                                    <label for='time4' className='btn btn-outline-success'>10:00 AM</label>
                                    <input type='radio' name='time' id='time5' className='btn-check' />
                                    <label for='time5' className='btn btn-outline-success'>10:00 AM</label>
                                    <input type='radio' name='time' id='time6' className='btn-check' />
                                    <label for='time6' className='btn btn-outline-success'>10:00 AM</label>
                                    <input type='radio' name='time' id='time7' className='btn-check' />
                                    <label for='time7' className='btn btn-outline-success'>10:00 AM</label>
                                    <input type='radio' name='time' id='time8' className='btn-check' />
                                    <label for='time8' className='btn btn-outline-success'>10:00 AM</label>
                                </fieldset>
                            </div>
                                :
                                <div>
                                    <div className='d-flex gap-2  ' >
                                        <div class="input-group mb-3 p-1  "  >
                                            <span class="input-group-text" id="inputGroup-sizing-default">First Name</span>
                                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" />
                                        </div>
                                        <div class="input-group mb-3 p-1 " >
                                            <span class="input-group-text" id="inputGroup-sizing-default">Last Name</span>
                                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" />
                                        </div>
                                    </div>
                                    <div className='d-flex gap-2'>
                                        <div class="input-group mb-3 p-1">
                                            <span class="input-group-text" id="inputGroup-sizing-default">Email Id</span>
                                            <input type="email" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" />
                                        </div>
                                        <div class="input-group mb-3 p-1">
                                            <span class="input-group-text" id="inputGroup-sizing-default">Mobile No</span>
                                            <input type="number" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" />
                                        </div>
                                    </div>
                                    <div className='d-flex gap-2 ' >
                                        <div class="input-group mb-3 p-1">
                                            <span class="input-group-text" id="inputGroup-sizing-default">Address</span>
                                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" />
                                        </div>
                                        <div class="input-group mb-3 p-1 ">
                                            <span class="input-group-text" id="inputGroup-sizing-default">City</span>
                                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" />
                                        </div>
                                    </div>
                                    <div className='d-flex gap-2 '>
                                        <div class="input-group mb-3 p-1 ">
                                            <span class="input-group-text" id="inputGroup-sizing-default">State</span>
                                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" />
                                        </div>
                                        <div class="input-group mb-3 p-1 ">
                                            <span class="input-group-text" id="inputGroup-sizing-default">Appointment for</span>
                                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" />
                                        </div>
                                    </div>
                                </div>}
                            <button type='button' onClick={()=>{setnext(true)}}>Prev</button>
